import React, { useState } from "react";

const daysOfMonth = Array.from({ length: 15 }, (_, i) => i + 1);

const dummyEmployees = [
  { id: 1, name: "Alice", hourly: 15, taxReport: "Completed" },
  { id: 2, name: "Bob", hourly: 18, taxReport: "Pending" },
];

export default function CPAEmployeeGrid() {
  const [selectedRange, setSelectedRange] = useState("1-15");

  const ranges = {
    "1-15": daysOfMonth.slice(0, 15),
    "16-end": Array.from({ length: 15 }, (_, i) => i + 16), // 필요시 마지막날까지 확장
  };

  const visibleDays = ranges[selectedRange];

  const renderDateColumn = (day) => (
    <div className="grid grid-rows-8 border border-gray-300 text-center">
      <div className="row-span-1 border-b">{day}</div>
      <div className="row-span-1 border-b grid grid-cols-2">
        <div>AM</div>
        <div>PM</div>
      </div>
      <div className="row-span-1 border-b grid grid-cols-4">
        <div>Hourly</div>
        <div>Tip</div>
        <div>Hourly</div>
        <div>Tip</div>
      </div>
      <div className="row-span-1 border-b grid grid-cols-4">
        <div>$12</div>
        <div>$5</div>
        <div>$14</div>
        <div>$6</div>
      </div>
    </div>
  );

  return (
    <div className="p-4 overflow-x-auto">
      <div className="mb-4 flex gap-4">
        {Object.keys(ranges).map((r) => (
          <button
            key={r}
            className={`px-3 py-1 rounded ${
              selectedRange === r ? "bg-blue-500 text-white" : "bg-gray-200"
            }`}
            onClick={() => setSelectedRange(r)}
          >
            {r}
          </button>
        ))}
      </div>

      <div className="inline-grid grid-cols-[200px_repeat(7,120px)] gap-0 border border-gray-300">
        <div className="grid grid-rows-8 border-r border-gray-300">
          <div className="row-span-8 border-b flex items-center justify-center font-bold bg-gray-100">
            Name
          </div>
          <div className="row-span-8 border-b flex items-center justify-center font-bold bg-gray-100">
            Hourly
          </div>
          <div className="row-span-8 flex items-center justify-center font-bold bg-gray-100">
            Tax Report
          </div>
        </div>

        {visibleDays.map((day) => (
          <React.Fragment key={day}>{renderDateColumn(day)}</React.Fragment>
        ))}

        {dummyEmployees.map((emp) => (
          <React.Fragment key={emp.id}>
            <div className="grid grid-rows-8 border-r border-gray-300">
              <div className="row-span-8 flex items-center justify-center border-b">
                {emp.name}
              </div>
              <div className="row-span-8 flex items-center justify-center border-b">
                ${emp.hourly}
              </div>
              <div className="row-span-8 flex items-center justify-center border-b">
                {emp.taxReport}
              </div>
            </div>

            {visibleDays.map((day) => (
              <div
                key={day}
                className="grid grid-rows-8 border border-gray-300 text-center"
              >
                <div className="row-span-1 border-b">{day}</div>
                <div className="row-span-1 border-b grid grid-cols-2">
                  <div>AM</div>
                  <div>PM</div>
                </div>
                <div className="row-span-1 border-b grid grid-cols-4">
                  <div>Hourly</div>
                  <div>Tip</div>
                  <div>Hourly</div>
                  <div>Tip</div>
                </div>
                <div className="row-span-1 border-b grid grid-cols-4">
                  <div>$12</div>
                  <div>$5</div>
                  <div>$14</div>
                  <div>$6</div>
                </div>
              </div>
            ))}
          </React.Fragment>
        ))}
      </div>
    </div>
  );
}
